var side = 20;
var grassArr = []
var grasEaterArr = []
var predatorArr = []
var energyArr = []
var rumbArr = []
function preload() {
    nkar = loadImage('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRkV8O1xxueVodw3gqQreOiLCxvej9waoxobQ&usqp=CAU');
    nkar2 = loadImage('data:image/jpeg;base64,');
    nkar3 = loadImage('https://media.istockphoto.com/id/842671590/vector/cartoon-bomb-illustration.jpg?s=612x612&w=0&k=20&c=jTzH12dWeRFqJwFzdgfuppVKSXxRN4bqP8ggewbjdxc=');
    nkar4 = loadImage('data:image/jpeg;base64,')
    nkar5=loadImage('data:image/jpeg;base64,')
}

function setup() {
    frameRate(10);
    createCanvas(matrix[0].length * side, matrix.length * side);
    background('#acacac');
    for (var y = 0; y < matrix.length; ++y) {
        for (var x = 0; x < matrix[y].length; ++x) {
            if (matrix[y][x] == 1) {
                var gr = new Grass(x, y, 1);
                grassArr.push(gr);
            }
            else if (matrix[y][x] == 2) {
                var grasEater = new GrassEater(x, y, 2)
                grasEaterArr.push(grasEater)
            }

            else if (matrix[y][x] == 3) {
                var p = new Predator(x, y, 3)
                predatorArr.push(p)
            }
            else if (matrix[y][x] == 4) {
                var p = new Energy(x, y, 4)
                energyArr.push(p)
            }
            else if (matrix[y][x] == 5) {
                var p = new Rumb(x, y, 5)
                rumbArr.push(p)
            }
        }
    }

}
function draw() {

    for (var y = 0; y < matrix.length; y++) {
        for (var x = 0; x < matrix[y].length; x++) {

            if (matrix[y][x] == 1) {
                image(nkar2, x * side, y * side, side, side);
            }
            else if (matrix[y][x] == 0) {
                fill(233, 203, 135);
                rect(x * side, y * side, side, side);
            }
            else if (matrix[y][x] == 2) {
                image(nkar, x * side, y * side, side, side);
            }
            else if (matrix[y][x] == 3) {
                image(nkar5, x * side, y * side, side, side);
            }
            else if (matrix[y][x] == 4) {
                image(nkar4, x * side, y * side, side, side);
            }
            else if (matrix[y][x] == 5) {
                image(nkar3, x * side, y * side, side, side);
            }


            /*
            fill("blue")
            text(x+" "+y, x*side+side/2,y*side+side/2)
            */
        }
    }


    for (var i in grassArr) {
        grassArr[i].mul()
    }
    for (var i in grasEaterArr) {
        grasEaterArr[i].eat()
        grasEaterArr[i].move()
        grasEaterArr[i].mult()
        grasEaterArr[i].die()

    }
    for (var i in predatorArr) {
        predatorArr[i].eat()
        predatorArr[i].move()
        predatorArr[i].mult()
        predatorArr[i].die()

    }
    for (var i in energyArr) {
        energyArr[i].mult()
        energyArr[i].move()
    }
    for (var i in rumbArr) {
        rumbArr[i].move()
        rumbArr[i].mult()
    }

    if (energyArr.length == 0) {
        for (var i = 0; i < 10; i++) {
            var x = floor(random(matrix[0].length - 1))
            var y = floor(random(matrix.length - 1))
            matrix[y][x] = 4
            var energy = new Energy(x, y, 4)
            energyArr.push(energy)
        }
    }

    if (rumbArr.length == 0) {
        for (var i = 0; i < 10; i++) {
            var x = floor(random(matrix[0].length - 1))
            var y = floor(random(matrix.length - 1))
            matrix[y][x] = 5
            var rumb = new Rumb(x, y, 5)
            rumbArr.push(rumb)
        }
    }
    if (grasEaterArr.length == 0) {
        for (var i = 0; i < 10; i++) {
            var x = floor(random(matrix[0].length - 1))
            var y = floor(random(matrix.length - 1))
            matrix[y][x] = 2
            var grasEater = new GrassEater(x, y, 2)
            grasEaterArr.push(grasEater)
        }
    }
}